import React from 'react';
import { NavLink, Link, useHistory } from 'react-router-dom';
import styled from 'styled-components';
import { useSelector, useDispatch } from 'react-redux';
// import { signout } from '../actions';

const Nav = () => {
  // const dispatch = useDispatch();
  // const history = useHistory();
  // const authenticated = useSelector((state) => state.auth.authenticated);
  // const name = useSelector((state) => state.auth.name);
  // const sleepRecordsCount = useSelector(
  //   (state) => state.sleepRecords.sleepRecordsCount
  // );

  // const handleSignOutClick = () => {
  //   dispatch(
  //     signout(() => {
  //       history.push('/');
  //     })
  //   );
  // };

  const renderLinks = () => {
    // if (authenticated) {
    // return (
    <>
      {/* <Link to="/personal">
        <li>Your Sleep Records</li>
      </Link> */}
      {/* <li>{name}</li> */}
      {/* <li>
        <LinkButton href="#" onClick={handleSignOutClick}>
          Sign Out
        </LinkButton>
      </li> */}
    </>;
    // );
    // }
    return (
      <>
        <li>
          <Link to="/signup">Sign Up</Link>
        </li>
        <li>
          <Link to="/signin">Sign In</Link>
        </li>
      </>
    );
  };

  return (
    <NavContainer>
      <div id="logo">
        <NavLink to="/">SleepyApp</NavLink>
      </div>

      <NavUl>{renderLinks()}</NavUl>
    </NavContainer>
  );
};

export default Nav;

const NavContainer = styled.div`
  position: fixed;
  z-index: 999;
  background: rgb(112, 128, 144);
  color: whitesmoke;
  margin: 0;
  width: 100%;
  height: 12%;
  padding: 1.5em;
  #logo {
    position: relative;
    float: left;
    width: 150px;
    height: auto;
  }
  a {
    color: #fff;
  }
`;

const NavUl = styled.ul`
  display: flex;
  flex-direction: row;
  justify-content: flex-end;
  list-style: none;
  li:first-child {
    float: left;
  }
  li {
    margin-left: 0.8em;
    padding: 0.5em;
  }
  li a {
    color: whitesmoke;
  }
`;

const LinkButton = styled.button`
  background: none;
  border: none;
  cursor: pointer;
  color: whitesmoke;
  font-family: Oswald, sans-serif;
  font-size: 20px;
`;
